import React, { Fragment } from 'react';

const Checkbox = props => {
    const {
        onChange,
        data: {id, descripcion, done}
        } = props;

    return (
        <Fragment>
            <label className="todo new-item">
                <input
                className="todo__state"
                name={id}
                type="checkbox"
                defaultChecked={done}
                onChange={onChange}
                />
                <div className="todo__text">{descripcion}</div>
            </label>
        </Fragment>
    );
}

export default Checkbox;
